Map::Map()
{
	water = TextureManager::LoadTexture("Assets/Sprites/Water.png");
	ground = TextureManager::LoadTexture("Assets/Sprites/Ground.png");

	tileset = new Tileset("Assets/Tilesets/test.png");

	LoadMap(lvl1);

	src.x = src.y = 0;
	src.w = dest.w = Tileset::TILE_SIZE;
	src.h = dest.h = Tileset::TILE_SIZE;

	dest.x = dest.y = 0;
}

void Map::LoadMap(int arr[128][128])
{
	for (int row = 0; row < 128; row++)
	{
		for (int column = 0; column < 128; column++)
		{
			map[row][column] = arr[row][column];
		}
	}
}

void Map::DrawMap()
{
	int type = 0;

	for (int row = 0; row < 128; row++)
	{
		for (int column = 0; column < 128; column++)
		{
			type = map[row][column];

			dest.x = column * Tileset::TILE_SIZE;
			dest.y = row * Tileset::TILE_SIZE;

			SDL_Rect drawingRect = { dest.x - Game::camera.x, dest.y - Game::camera.y, dest.w, dest.h };

			switch (type)
			{
			case 0:
				tileset->vTiles[0].DrawTile(src, drawingRect);
				break;
			case 1:
				tileset->vTiles[1].DrawTile(src, drawingRect);
				break;
			default:
				break;
			}
		}
	}
}